import React from 'react';
import {Route} from "react-router-dom";
import Articles from './components/Articles';
import Header from './components/Header';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import CovidList from './components/CovidsList';
import PoliticsList from './components/PoliticsList';
import Sports from './components/CovidsList';
import "bootstrap/dist/css/bootstrap.min.css";

import './App.css';

function App() {
  return (
    <div className="App">
      <Navbar />
      <Header />
      <Route to='/'  exact component={Articles} />
      <Route path='/covidsList' exact component={CovidList} />
      <Route path='/politicsList' exact component={CovidList} />
      <Route path='/sportsList' exact component={CovidList} />

      {/* <Footer /> */}
    </div>
  );
}

export default App;
